  return (
    <div>
      <h2>Fiber Architecture:</h2>
      {console.log("parentFiber", (<Parent />)._owner)}
      <p>Parent of Parent fiber - Parent._owner.return</p>
      <p>Parent fiber - Parent._owner.return</p>
      <p>Child 1 fiber - Parent._owner.child</p>
      <p>Child 2 fiber - Parent._owner.child</p>
    </div>
  );
};

export default FiberArchitecture;
